member.summary:
When an invalid data row is encountered, the following error codes will be returned:
Add: -483 or -1051;
Update: -483 or -1051;

When an invalid data row is encountered, the following return codes will be used:
Success: 1001;
Partial Success: 1002;

When an unknown element is encountered, the following error codes will be returned:
Get: -469;
Add: -409;
Update: -483;
Delete: -469;

When an unknown element is encountered, the following return codes will be used:
Success: 1001;
Partial Success: 1002;
